INSERT INTO `penyakits` (`id`, `nama_penyakit`, `penjelasan`, `created_at`, `updated_at`) VALUES
(3, 'Penyakit Radang Mata (Pinkeye)', 'Pink Eye disebabkan oleh bakteri, virus, rikketsia maupun chlamydia, paling sering dijumpai adalah Pink Eye yang disebabkan bakteri Maraxella bovix. Pink Eye merupakan penyakit mata akut yang menular pada sapi, domba maupun kambing. Penyakit ini tidak sampai menimbulkan kematian, akan tetapi kerugian yang didapat cukup besar bagi peternak, karena penyakit ini menyebabkan kebutaan, penurunan berat badan dan biaya pengobatan yang cukup mahal.', '2023-02-03 00:47:39', '2023-02-06 02:58:19'),
(4, 'Endometrisis', 'Endometritis merupakan radang pada mukosa uterus. Penyakit ini merupakan penyebab kemandulan pada sapi perah. Terjadi karena infeksi mikroorganisme yang masuk kedalam uterus, melewati vagina dan serviks, biasa terjadi setelah kelahiran yang abnormal. Penyakit ini disebabkan oleh beberapa jenis bakteri seperti, Streptococcus, Staphylococcus, E. Coli, Trichomonas foetus dan beberapa bakteri lainnya. (Sjafarjanto 2019)', '2023-04-18 03:08:22', '2023-04-18 03:08:22'),
(5, 'Ratensio Secondarium (Ratensio Placenta)', 'Penyakit ini adalah tertahannya selubung Foetus (secundinae) didalam uterus, setelah Foetus dilahirkan (normal, abortus, dystochia, prematur). Ratensio Placenta dapat disebabkan oleh beberapa faktor, yaitu gangguan mekanisme, kekuatan induk, dan gangguan  pelepasan. Biasanya terjadi pada sapi yang plasenta tidak keluar atau tertahan 24 jam postpartus. Sapi yang menderita penyakit ini akan sulit dalam mengeluarkan urine. (Sjafarjanto 2019)', '2023-04-18 03:08:51', '2023-04-18 03:08:51'),
(6, 'Keracunan', 'Penyebab penyakit ini adalah pakan yang dikonsumsi oleh ternak mengandung zat sianida. Zat sianida atau CN- biasa ditemui di tanaman ubi kayu yang masih segar. Para peternak dapat menurunkan kandungan (detoksifikasi) zat sianida ini dengan cara menjemur (pengeringan) dan pengupasan kulit umbi sebelum diberikan kepada ternak. Kulit umbi merupakan bagian yang memiliki zat sianida paling tinggi dibandingkan dengan bagian lain. Sapi yang terlalu banyak mengkonsumsi zat sianida akan langsung mati setelah 15-20 menit setelah timbul gejala klinis seperti kejang, mulut berbuih, dan sempoyongan. (Sjafarjanto 2019)', '2023-04-18 03:09:35', '2023-04-18 03:09:35'),
(7, 'Penyakit Demam Tiga Hari', 'Penyakit ini disebut juga penyakit bovine ephemeral fever (BEF). Merupakan penyakit yang bersifat akut yang disertai demam, dengan jumlah pengidap yang tinggi, tetapi angka kematian tergolong rendah. Rhabdovirus adalah penyebab dari penyakit ini. Virus ini tergolong dalam famili yang sama dengan virus rabies dan vesicular stomatitis. Virus ini ditularkan melaui serangga. Masa inkubasi berlangsung 2 hingga 10 hari. Virus yang masuk akan berkembang biak di organ dalam bagian pernafasan dan limpa. (Sjafarjanto 2019)', '2023-04-18 03:10:01', '2023-04-18 03:10:01'),
(8, 'Myasis (Belatungan)', 'Penyakit Mysasis atau belatungan merupakan serangan larva dalam jumlah yang banyak (infestasi) yang masuk lewat luka terbuka. Penyakit ini tidak membahayakan hewan ternak, akan tetapi jaringan yang terserang larva ini akan habis termakan larava tersebut. Lalat hijau (Callitroga americana dan Chrysomya bezziana) akan terbang mencari luka yang terbuka untuk meletakkan 150 – 500 butir telur. Luka yang digemari larva ini adalah luka yang terletak di daerah yang sulit dijangkau oleh mulut, ekor dan bagian yang tidak bergerak. (Sjafarjanto 2019)', '2023-04-18 03:10:24', '2023-04-18 03:10:24'),
(9, 'Milk Fever (Hypocalcemia)', 'Milk Fever atau dalam istilah medisnya Hypocalcemia ialah  gangguan metabolisme yang sering dijumpai pada sapi perah setelah melahirkan, terutama pada sapi perah yang berproduksi susu tinggi. Gangguan kesehatan ini terdapat beberapa tingkatan, untuk stadium 1 gejala klinis yang akan muncul diantaranya, sapi akan tampak gelisah, ekspresi cemas, sempoyongan, kaki kaku saat berdiri, dan moncong sapi kering. Pada stadium 2 gejala klinis yang timbul paling mencolok adalah sapi akan berbaring, dengan posisi dada kanan bawah dan kepalah diletakkan pada dada kiri, gangguan makan atau istilah medisnya anoreksia, suhu terkadang normal (dibawah 38oC) kadang abnormal (diatas 39oC), dan rektum terdapat tinja kering. Pada stadium 3 dimana sapi akan tetampak sangat lemah, tidak mampu lagi untuk bangun dengan posisi berbaring pada satu sisi (kanan), reflek pada mata negatif dan pupil mata melebar. (Sjafarjanto 2019)', '2023-04-18 03:10:44', '2023-04-18 03:10:44'),
(10, 'Penyakit Masitis', 'asitis merupakan istilah lain dari peradangan pada ambing atau peradangan kelenjar susu yang merupakan penyakit menular yang disebabkan oleh beberapa jenis bakteri. Ada beberapa bakteri yang diketahui sebagai penyebab radang ambing yaitu Streptococcus agalactiae, Streptococcus dusgalactiae, Streptococcus uberis, dan lain-lain. Masitis sering terjadi pada sapi perah. Kuman akan menginfeksi melaui lubang putting. Infeksi terjadi karena terbuk lubang saluran putting yang melebar, terutama setalah dilakukanya pemerahan. Lokasi pemerahan wajib selalu disterilisasi, guna mengurangi infeksi bakteri. (Sjafarjanto 2019)', '2023-04-18 03:11:10', '2023-04-18 03:11:10'),
(11, 'Penyakit Cacing Hati (Faciolosis)', 'Cacing Fasciola gigantica maupun Fasciola hepatica yang menginfeksi hati sapi. Kebanyakan kasus cacing Fasciola gigantica yang sering menyerang hewan ternak. Gejala klinis yang muncul ketika sapi terinfeksi antara lain, terjadi gangguan pada pencernaannya, kurus, lemah, dan depresi. Pada perut sapi (abdomen) sebelah kanan membesar, keras, dan nyeri (lokasi hati). Jika tidak segera ditangani atau diobati sapi akan mati setelah 1 hingga 3 bulan terinfeksi. (Sjafarjanto 2019)', '2023-04-18 03:11:38', '2023-04-18 03:11:38'),
(12, 'Penyakit Radang Mata (Pinkeye)', 'Pink Eye disebabkan oleh bakteri, virus, rikketsia maupun chlamydia, paling sering dijumpai adalah Pink Eye yang disebabkan bakteri Maraxella bovix. Pink Eye merupakan penyakit mata akut yang menular pada sapi, domba maupun kambing. Penyakit ini tidak sampai menimbulkan kematian, akan tetapi kerugian yang didapat cukup besar bagi peternak, karena penyakit ini menyebabkan kebutaan, penurunan berat badan dan biaya pengobatan yang cukup mahal.', '2023-04-18 03:12:00', '2023-04-18 03:12:00'),
(13, 'Tetanus', 'Tetanus merupakan penyakit infeksi akut yang dapat menyerang manusia dan beberapa hewan lain, kecuali unggas. Tetanus disebabkan oleh kuman Clostridium tetani, tergolong kuman yang bersifat anerob yang berarti kuman yang tidak dapat tumbuh pada kondisi ada oksigen. Clostridium tetani juga membentuk spora sebagai bentuk pertahanan diri yang terdapat di dalam tanah dan mencermari benda-benda. Infeksi kuman Clostridium tetani melalui luka yang kecil dan dalam biasanya luka tusukan yang menutup yang menyebabkan kondisi anaerob. Ketika terinfeksi, sapi akan demam tinggi dengan suhu 42¬¬¬o C – 43o C setelah mengalami kejang. Sebelum kejang-kejang, sapi tampak gelisah dan agresif. (Sjafarjanto 2019)', '2023-04-18 03:12:19', '2023-04-18 03:12:19');
INSERT INTO `solusi` (`id`, `penyakit_id`, `deskripsi_solusi`, `created_at`, `updated_at`) VALUES
(1, 4, 'Irigasi uterus dengan cairan antiseptik RL.', '2023-06-08 08:54:18', '2023-06-08 08:54:18'),
(2, 4, 'Memberi antibiotika bolus intra uterine.', '2023-06-08 08:54:18', '2023-06-08 08:54:18'),
(3, 4, 'Injeksi antibiotika IM.', '2023-06-08 08:54:18', '2023-06-08 08:54:18'),
(4, 5, 'Pelepasan ikatan vili - caruncula secara manual, eksplorasi intravaginal 24-36 jam setelah melahirkan.', '2023-06-08 08:56:35', '2023-06-08 08:56:35'),
(5, 5, 'Irigasi uterus dengan antiseptik RL, hingga bersih, kemudian diberi bolus antibiotika', '2023-06-08 08:56:35', '2023-06-08 08:56:35'),
(6, 6, 'Dilakukan infus / IV menggunakan atropin sulfat.', '2023-06-08 09:08:08', '2023-06-08 09:08:08'),
(7, 6, 'Di IV dengan cairan HS/RL.', '2023-06-08 09:08:08', '2023-06-08 09:08:08'),
(8, 6, 'Di + antihistamin vetadril (dipen).', '2023-06-08 09:08:08', '2023-06-08 09:08:08'),
(12, 7, 'Suportif, dengan memberi antiseptik analgesic.', '2023-06-08 09:09:25', '2023-06-08 09:09:25'),
(13, 8, 'Disiram larutan H2O2 untuk membersihkan jaringan yang rusak.', '2023-06-08 09:12:20', '2023-06-08 09:12:20'),
(14, 8, 'Disemprot jusanex', '2023-06-08 09:12:20', '2023-06-08 09:12:20'),
(15, 8, 'Dibersihkan menggunakan antiseptik RL.', '2023-06-08 09:12:20', '2023-06-08 09:12:20'),
(16, 8, 'Pemberian Antibiotika', '2023-06-08 09:12:20', '2023-06-08 09:12:20'),
(17, 9, 'Bagi penderita yang terus berbaring, agar diubah-ubah posisi berbaringnya dan diberi jerami sebagai alas berbaring.', '2023-06-08 09:13:31', '2023-06-08 09:13:31'),
(18, 9, 'Pemberian kalsium, magnesium dan fosfor.', '2023-06-08 09:13:31', '2023-06-08 09:13:31'),
(19, 9, 'Berikan suntikan Vitamin A,D,E', '2023-06-08 09:13:31', '2023-06-08 09:13:31'),
